import React from 'react';
import Field from './Filter/Field';

const Menu = (props) => {
    return (
        <>
            <div className="col-md-3 produit">
                <div className="row">
                    <h3>{props.title}</h3>
                </div>
                <Field libelle={"Price min"} />
            </div>
        </>
    );
};

export default Menu;
